<head>
  <meta charset="UTF-8">

  <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css">
  
<style>
  body, html {
    margin: 0;
    padding: 0;
    width:100%;
    height: 100%;
    border-right: 20px solid orange;
    border-left: 20px solid orange;
  }

  .banner img {
    padding: 40px;
    max-width: 100%;
    height: auto;
    max-height:80vh; 
    object-fit:contain;
    transition: transform 0.2s;
  }
 
  .banner img:hover{
    transform: scale(1.15);
  }

  .tablepic img {
    max-width: 100%;
    height: auto; 
    object-fit: contain; 
    transition: transform 0.2s;
  }
  .tablepic img:hover {  
    transform: scale(1.15);
  }
  

  .container {
    display: flex;
    flex-direction: column;
    width:100%;
    height: 100%;
  }

  .banner {
    width: 100%;
    flex-shrink: 0; 
    background-color: white;
    text-align: center;
    display: flex;
    justify-content: center;
    align-items: center;
}

  .content {
    display: flex;
    flex: 1; 
    justify-content: space-between;
    align-items: center; 
    padding: 20px;
    box-sizing: border-box;
  }

  .tablepic, .video-container {
    flex: 1; 
    padding: 10px; 
  }

  .image-video-container {
      display: flex;
      align-items: flex-start; 
      justify-content: flex-start; 
      padding-right: 40px;
      gap: 20px; 
    }
  .video-container iframe {
      width: 560px; 
      height: 315px;
  }
  </style>
